    heading: "Digital Marketing",
  },
  {
    pic: pic4,
    heading: "Social Media",
  },
  {
    pic: pic5,
    heading: "SEO",
  },
  {
    pic: pic6,
    heading: "Training/Internship",
  },
  {
    pic: pic7,
    heading: "Start Up Consultancy",
  },
  {
    pic: pic8,
    heading: "Wen Hosting",
  },
];

export default data;
